export default  {
    palette: {
        primary: {
            light: '#b0fdfa',
            main: '#61a0e2',
            dark: '#323534',
            contrastText: '#ffffff'
        },
        secondary: {
            light: '#323534',
            main: '#FFFFFF',
            dark: '#29bdc1',
            contrastText: '#929292'
        }
    },
    typography: {
        useNextVarients: true,
        button: {
            display: 'inline-block',
            padding:0,
            maxHeight: 0,
            maxWidth: 0,
            textTransform: "none"
        }
    }
}
